(14, 'Perubahan Jam Kerja', 'Dear Semua karyawan PT. Aerofood Indonesia,\n\n Khusus hari senin, 8 Januari 2018 Jam kerja PT. Aerofood Indonesia berubah menjadi 09.00 - 17.00\n Demikian Informasi yang disampaikan mohon maaf bila ada kesalahan.\n \nHormat Saya,\n\nTerima Kasih\n', 2, 1, 80, 1, 9, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1),
(15, 'Perubahan Jam Kerja', 'Dear Semua karyawan PT. Aerofood Indonesia departement QHSE,\n\n Khusus hari senin, 8 Januari 2018 Jam kerja PT. Aerofood Indonesia berubah menjadi 09.00 - 17.00\n Demikian Informasi yang disampaikan mohon maaf bila ada kesalahan.\n \nHormat Saya,\n\nTerima Kasih', 1, 2, 80, 0, 9, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1),
(16, 'Perubahan Jam Training', 'Dear Teman - teman QHSE,\n \n Terdapat training yang wajib dilakukan oleh seluruh teman QHSE. Training akan dibuka pada tanggal 25 November 2018\n- 27 November 2018 silahkan dilihat pada modul mandatory training masing-masing\n \n\nHormat Saya,\n\nTerima Kasih', 1, 1, 0, 1, 9, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1),
(17, 'Jadwal Training', 'Dear teman,\n\n Saya mau bertanya apakah benar bawa training functional kita akan dilakukan pada senin, 15 Desember 2017?\nKarena saya mendapat kabar dari rekan saya bahwa training tersebut berubah dari tanggal sebelumnya yaitu tanggal\n11 Desember 2017.\n\nHormat Saya,\n\nTerima Kasih,', 2, 2, 80, 0, 9, '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1),
