INSERT INTO `modul_trainings` (`id`, `modul_name`, `id_parent`, `is_active`, `description`, `date`, `time`, `id_department`, `is_publish`, `is_child`, `created_by`, `created_at`, `updated_at`) VALUES
(1, 'Induction Training', 0, 1, 'Training ini wajib diikuti 1x oleh semua karyawan Aerofood Indonesia agar dapat mengakses training lainya yaitu Mandatory Training, Functional Training, Supporting Training dan juga Development Training. ', NULL, NULL, NULL, 1, 0, 0, '2017-12-29 10:10:01', '2017-12-29 10:10:01'),
(2, 'Mandatory Training', 0, 1, 'Training ini wajib diikuti oleh semua karyawan PT. Aerofood Indonesia. Training ini bertujuan untuk membantu karyawan mengingat kembali pengetahuan tentang PT. Aerofood Indonesia. Training ini bersifat berkala dan dilakukan pada jangka waktu tertentu', NULL, NULL, NULL, 1, 0, 0, '2018-01-04 09:33:47', '2018-01-04 09:33:47'),
(3, 'Functional Training', 0, 1, 'Training ini bertujuan untuk memperdalam pengetahuan karyawan tentang pekerjaan yang sedang dilakukan selama di PT. Aerofood Indonesia. Training ini berbeda disetiap Departementnya.', NULL, NULL, NULL, 1, 0, 0, '2018-01-04 09:33:47', '2018-01-04 09:33:47'),
(4, 'Supporting Training', 0, 1, 'Training ini hanya dikhusukan untuk level manager keatas. Training ini dapat membantu melatih jiwa kepemimpinan karyawan Aerofood.', NULL, NULL, NULL, 1, 0, 0, '2018-01-04 09:37:48', '2018-01-04 09:37:48'),
(5, 'Development Training', 0, 1, 'Training ini adalah training tambahan yang bisa diikuti karyawan training ini memberikan materi yang tidak didapatkan di-training sebelumnua', NULL, NULL, NULL, 1, 0, 0, '2018-01-04 09:37:48', '2018-01-04 09:37:48'),
