(2, 'California: Thirteen dead in Montecito rains and mudslides', 1, '<div style=\"text-align: justify; \"><div>At least 13 people are dead amid \"waist-deep\" mudslides in Southern California, where heavy rains triggered flooding, say officials. Some 163 people have been taken to hospital. Twenty had \"storm-related injuries\" and four were critically hurt. A group of up to 300 people are reportedly trapped in Romero Canyon, east of Santa Barbara.</div><div><br></div><div>Police said the scene \"looked like a World War One battlefield\". boulders the size of cars slammed into roadwaysImage copyrightTWITTER/ @ELIASONMIKE Image caption Boulders the size of cars rolled down hills and slammed into roadways The flooding and mudslides, affecting areas scorched by wildfires last month, have shut down more than 30 miles (48km) of the main coastal road.&nbsp; Emergency services said a number of people were unaccounted for and they expected the number of deaths to rise. Thousands fled the deluge and more than 50 rescues have been performed.&nbsp; The hardest-hit homes were those that were not in the evacuation zone, officials say.</div></div>', 1, 1, NULL, 1, '2018-01-10 08:51:57', '2018-01-10 02:05:05', 1),
(3, 'Japanese astronaut sorry for 9cm ISS growth mistake', 1, '<div style=\"text-align: justify; \">A Japanese astronaut has apologised for wrongly stating he has grown 9cm (3.5in) since arriving at the International Space Station (ISS) just over three weeks ago.</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">Norishige Kanai said in fact he grew by 2cm, blaming \"a measurement mistake\". \"I\'m very sorry for tweeting out such fake news,\" he tweeted in Japanese. His original incorrect claim sparked global fascination among social media users. Astronauts grow an average of between 2-5cm in space.&nbsp;</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">This is because of the absence of gravity which allows the vertebrae in their spines to spread apart. \'A bit relieved\' Mr Kanai originally tweeted (in Japanese): \"Good morning, everybody. I have a major announcement today. We had our bodies measured after reaching space, and wow, wow, wow, I had actually grown by as much as 9cm!&nbsp; \"I grew like some plant in just three weeks. Nothing like this since high school. I\'m a bit worried whether I\'ll fit in the Soyuz seat when I go back.\"&nbsp;</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">But later on, he tweeted that his Russian commander on the ISS, Anton Shkaplerov, was sceptical, \"so I quickly measured myself and was roughly 182 cm. 2 cm plus my height on earth\".&nbsp;</div><div style=\"text-align: justify;\"><br></div><div style=\"text-align: justify;\">\"So it was a measurement mistake (?), but it seems many people are talking about it. \"I have no back pains, and actually the pain around my neck and shoulders is gone, so I doubt I\'m 9 cm taller. Flight Commander Shkaplerov would know these things, he\'s such a veteran.\"&nbsp;</div><div style=\"text-align: justify; \">What happens to your body in space? Mr Kanai said he was a \"bit relieved\", adding: \"I\'ll probably fit into the Soyuz when I go home.\" The Soyuz spacecraft which takes the astronauts from and to Earth has a limit on seating height. If crew members become too tall, it could pose a problem. Skin-tight suits for space explorers Out-of-this-world astronaut facts Astronauts can grow while in space and return to a normal height when they go back to Earth. This is the first space mission for the Japanese astronaut who was previously a diving medical officer with the Japan Maritime Self-Defense Force.</div>', 1, 1, NULL, 1, '2018-01-10 08:55:35', '2018-01-10 02:07:11', 1),
(4, 'A 14-year-old girl who as a child was the face', 1, '<p style=\"text-align: justify; \">A 14-year-old girl who as a child was the face of iconic Australian outback hat firm Akubra has taken her own life over cyberbullying, say her family.</p><p style=\"text-align: justify;\">In a Facebook post, the father of Amy \"Dolly\" Everett called for more awareness of bullying so his daughter\'s life \"will not be wasted\".</p><p style=\"text-align: justify;\">Akubra also expressed its condolences, issuing a call for all to \"stand up\" against any kind of bullying.</p><p style=\"text-align: justify;\">One in five children in Australia say they were bullied in the past year.</p><p style=\"text-align: justify;\">In his emotional Facebook post, written on Sunday, Dolly\'s father, Tick Everett, said she had wanted to \"escape the evil in this world\" but would \"never know the great pain and emptiness left behind\".</p><p style=\"text-align: justify;\">He gave no details of the bullying, but said he hoped the attention on Dolly\'s death might \"help other precious lives from being lost\".</p><p style=\"text-align: justify;\">He also invited the bullies to her funeral, saying: \"If by some chance the people who thought this was a joke and made themselves feel superior by the constant bullying and harassment see this post, please come to our service and witness the complete devastation you have created.\"</p><p style=\"text-align: justify;\">\'Dolly could be anyone\'s daughter\'</p><p style=\"text-align: justify;\">The wide-brimmed rabbit-fur Akubra hat is one of Australia\'s most recognisable brands, closely associated with rural outback life.</p><p style=\"text-align: justify;\">Dolly starred in a well-known ad campaign for the brand when she was eight.</p><p style=\"text-align: justify;\">According to the company, she had felt \"overwhelmed\" before her death last week.</p><p style=\"text-align: justify;\">\"Bullying of any type is unacceptable,\" the company wrote on Facebook on Tuesday.</p><p style=\"text-align: justify;\">An Akubra hatImage copyrightINSTAGRAM/AKUBRA</p><p style=\"text-align: justify;\">Image caption</p><p style=\"text-align: justify;\">Akubra hats are a staple of Australian culture</p><p style=\"text-align: justify;\">\"It is up to us to stand up when we see any kind of bullying behaviour. Dolly could be anyone\'s daughter, sister, friend.\"</p><p style=\"text-align: justify;\">It urged readers: \"Be a friend, check up on your mates.</p><p style=\"text-align: justify;\">Zero suicide - is it achievable?</p><p style=\"text-align: justify;\">Woman kills self \'over WhatsApp bullying\'</p><p style=\"text-align: justify;\">According to Australia\'s National Centre Against Bullying (NCAB), while overall bullying rates have marginally declined over the past decade, cyberbullying has seen a sharp increase.</p><p style=\"text-align: justify;\">\"What\'s different in the case of cyberbullying is that it can be constant, 24/7,\" Jeremy Blackman of the NCAB told the BBC.</p><p style=\"text-align: justify;\">\"Another big factor is the anonymity on the internet,\" he said, explaining this can make it harder for people to feel any empathy for their victims.</p><p style=\"text-align: justify;\">\"What it means it that more children can be bullies,\" he says.</p><p style=\"text-align: justify;\">Despite services and help lines available, teenagers are very reluctant to report when they are victims of bullying, according to NCAB, and only reach out for help if their situation has become unbearable.</p><p style=\"text-align: justify;\">There are no official statistics on suicides due to bullying. While national suicide rates in Australia are declining, the number of people between 15 and 24 taking their own life has seen a rise in recent years.</p><p style=\"text-align: justify;\">If you are feeling emotionally distressed and would like details of organisations in the UK which offer advice and support, go to bbc.co.uk/actionline.</p><p style=\"text-align: justify;\">If you in Australia, you can call Lifeline at 131114, Kids Helpline at 1800 55 18000 or visit the National Centre Against Bullying website.</p>', 1, 1, 'file_img/1.beranda.png', 1, '2018-01-10 08:59:45', '2018-01-10 02:38:13', 1),
(5, 'Is MicroLED an OLED killer? Not so fast.', 1, '<p class=\"MsoNormal\" style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">Organic light-emitting\r\ndiode TVs made by LG are the current image quality kings, so you might be\r\nwondering if MicroLED, the first entirely new display tech to be commercialized\r\nsince OLED in 2013, has a chance to take it out.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">I wouldn\'t bet on it, at\r\nleast in the next few years.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">In terms of image\r\nquality, from my few minutes looking at Samsung\'s demo footage on the wall, it\r\nhas the potential to match OLED. Black levels looked perfectly black, and\r\ncombines with the searing light output delivered superb pop and contrast. From\r\nany normal seating distance (well, I was standing, but whatever), the image was\r\nperfectly sharp, and I couldn\'t really see any \"seams\" of the\r\nindividual modules. So yes, it looks as good or better than OLED, which can\'t\r\nget as bright, based on my limited time viewing it. I\'ll have to get more time\r\nwith real-world material, however, to say for sure.</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:16.5pt\"><span style=\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">On the bottom is a MicroLED panel,\r\nand the top a tablet showing a mangnified section that reveals the LEDs.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#959595\"><br></span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#959595\">David Katzmaier/CNET</span></p><p class=\"MsoNormal\" style=\"margin-bottom:0in;margin-bottom:.0001pt;text-align:\r\njustify;line-height:normal\"><span style=\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#959595\"><br></span><span style=\"font-size:14.0pt;font-family:&quot;Times New Roman&quot;,&quot;serif&quot;;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\"><o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">The issue isn\'t image\r\nquality, it\'s whether a MicroLED set can be manufactured in a size and quantity\r\nto actually compete against OLED in the mainstream market.&nbsp;<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">In a conversation with\r\nSamsung representatives, the first hurdle they cited is manufacturing yield.\r\nEach individual red, green and blue LED subpixel -- which measure about 1mm\r\nsquare with 1mm distance between them (what they call \"pitch\") -- had\r\nto be placed precisely in the manufacturing process, and it\'s not easy. Samsung\r\nhas expertise in semiconductors as well as displays, so it\'s well positioned to\r\ntackle the issue, they say, but even so it\'s a challenge.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">The next step, says\r\nSamsung, is to produce a 75-inch size at 4K resolution. That\'s roughly half the\r\nsize of the current 146-inch iteration, and will require both smaller LEDs and,\r\nmore difficult, even narrower pitch between them. I asked how long it might\r\ntake before a 75-inch MicroLED TV hit the market, and a representative said\r\nsomewhere between two and five years.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">While 75-inch TVs are\r\nbecoming increasingly common, they\'re hardly mainstream. The vast majority of\r\nOLED sets sold are either 55 or 65 inches and Samsung didn\'t speculate on when\r\nwe\'d see even smaller MicroLED sets. I also asked whether they might decide to\r\nmake the technology in a lower-than-4K resolution, which would allow smaller screen\r\nsizes, but was told that wasn\'t on the radar.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 14pt; font-family: Helvetica, sans-serif;\">Beyond saying it would\r\nship this year, no pricing or availability was announced. Of course I asked,\r\nbut Samsung\'s reps wouldn\'t give any hints on pricing. If I had to guess, I\'d\r\nsay The Wall will cost $100,000.&nbsp;<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:14.0pt;\r\nline-height:115%\"><o:p>&nbsp;</o:p></span></p>', 1, 1, NULL, 1, '2018-01-10 09:10:30', '2018-01-10 09:10:30', 1),
(6, 'YouTube woes for Amazon', 1, '<p class=\"MsoNormal\" style=\"margin: 11.25pt 0in; text-align: justify; line-height: 12.85pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-family: Helvetica, sans-serif; font-size: 12pt;\">The unveiling of the\r\nsmart displays comes at a difficult time in Google and Amazon\'s relationship.\r\nWhile the tech titans have worked together plenty of times in the past -- such\r\nas when Amazon integrated Google\'s Nest devices with Alexa -- they are now in a\r\npublic spat.</span><br></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\">Last month, Google said\r\nit would&nbsp;<a href=\"https://www.cnet.com/news/youtube-to-cut-access-to-amazon-fire-tv-on-january-1-echo-show/\"><span style=\"color: black;\">cut off access</span></a>&nbsp;to\r\nYouTube on Amazon\'s Fire TV video streamers and the&nbsp;<a href=\"https://www.cnet.com/products/amazon-echo-show/review/\"><span style=\"color: black;\">Echo Show</span></a>,\r\nsaying it was unhappy Amazon removed its Chromecast devices from Amazon.com.\r\nAmazon soon after&nbsp;<a href=\"https://www.cnet.com/news/amazon-to-start-selling-apple-tv-and-google-chromecast/\"><span style=\"color: black;\">brought back\r\nChromecasts</span></a>&nbsp;to its online store, and Google said it was\r\n\"in productive discussions\" with Amazon to reach an agreement.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\">Despite the timing,\r\nGummi Hafsteinsson, product management director for Google Assistant, said the\r\nYouTube dustup with Amazon was unrelated to the smart displays\' unveiling and\r\n\"are separate issues.\"<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\">But, even with YouTube\r\npotentially returning to the&nbsp;<a href=\"https://www.cnet.com/products/amazon-echo-show/review/\"><span style=\"color: black;\">Echo Show</span></a>&nbsp;sometime\r\nthis year, Amazon should face a lot more competition when these new smart\r\ndisplays go on sale in the coming months. <o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\"><a href=\"https://www.cnet.com/ces/\"><span style=\"color: black;\">CES 2018</span></a>: CNET\'s complete coverage of tech\'s\r\nbiggest show.<o:p></o:p></span></p><p class=\"MsoNormal\" style=\"margin-bottom: 15pt; text-align: justify; line-height: 18pt; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><span style=\"font-size: 12pt; font-family: Helvetica, sans-serif;\"><a href=\"https://www.cnet.com/road-trip/\"><span style=\"color: black;\">The Smartest Stuff</span></a>: Innovators are\r\nthinking up new ways to make you, and the things around you, smarter.<o:p></o:p></span></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"text-align:justify\"><span style=\"font-size:12.0pt;\r\nline-height:115%\"><o:p>&nbsp;</o:p></span></p>', 1, 1, NULL, 1, '2018-01-10 09:12:38', '2018-01-10 09:12:38', 1),
(7, 'A ton of TVs', 1, '<h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">A ton of TVs</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">TVs are always big at CES, both in how many there are and in the size of the TVs themselves. And you can always leave it to LG to get the ball rolling. The company\'s early morning press conference showed updates to all of its TVs, from the top-of-the-line W8 series down to the more budget-friendly B8 series. They all retain slim profiles -- the W8 has the same \"wall art\" design that we saw last year in the W7 -- but gets new features like Google Assistant, an Alpha 9 processor that promises to improve sharpness and color (among other things), and the ability to play high frame rate (up to 120 frames per second) video for a smoother picture.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">What really wowed us, though, was a 65-inch 4K OLED display that you can roll up into tube form. Two years ago we saw the same concept in an 18-inch size: Resolution wasn\'t stellar then, but this time the rollable display should match the high picture quality that we\'ve come to expect from LG\'s standard TVs. Just don\'t expect to buy this one at Best Buy anytime soon.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">Samsung is pitching QLED technology as the best way to topple OLED dominance. Like the the company\'s 2017 models, its 2018 flagship LCD TV uses quantum dots (that\'s where you get the \"Q\" in QLED) but adds a few improvements like a redesigned LCD panel to block interior light leakage.&nbsp;</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">In the land of things you can\'t really buy yet, Samsung showed a 146-inch TV called \"The Wall.\" It uses Samsung\'s Cinema Screen technology, designed for movie theaters, so 146 inches is only a starting size. How does MicroLED work? Think of it like a jumbo screen at a stadium where an array of millions of individial, tiny LEDs create an image. Samsung also showed the Q9S, which it bills as the first 85-inch 8K TV with artificial intelligence. More pixels than a 4K TV may sound&nbsp; impressive, but keep in mind that more pixels doesn\'t automatically mean a better picture.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">Sony also went big with its X900F series of TVs that range from 49 inches all the way to 85 inches. That\'s even bigger than last year\'s X900E series, which was one of the best-performing LCD TVs CNET reviewed last year. Like its predecessor, the X900F also has Google Assistant, but adds Dolby Vision high dynamic range compatibility and a new stand design.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">The new OLED A8F series has Sony\'s Acoustic Surface speaker design, where the screen itself actually produces sound (cool!). It comes with Dolby Vision and HDR10 high dynamic range formats, Android TV, and support for both Google Assistant and Alexa.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">Though Hisense focused on budget TVs last year (and had a strong showing), the company went more upscale this year with models using full-array local dimming, quantum dot color technology and compatibility with Alexa voice control. The company also showed a $10,000 laser TV that it introduced in late 2017. It\'s actually a short-throw projector with 4K resolution, built-in speakers and a wireless subwoofer.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">Arriving in Las Vegas, CNET\'s TV guru David Katzmaier\'s had high hopes for Hisense\'s Chinese rival, TCL. The company\'s P series, introduced last year at CES, was 2017\'s the best 55-inch TV for the money. Today TCL showed a successor TV, the 2018 6 series, which looks even better. It keeps features like full-array local dimming and Roku\'s excellent Smart TV system, but adds a 65-inch size and a slicker finish.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Arial\"><span style=\"font-size: 18.6667px;\">Nvidia\'s CES press conference was Sunday night, but its BFGD is still worth a mention. Short for Big Format Gaming Display, not surprisingly it\'s a 65-inch display built for gamers with features like a native 120Hz refresh rate and true high dynamic range (HDR).</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><br></h2>', 1, 1, NULL, 1, '2018-01-10 09:21:56', '2018-01-10 09:21:56', 1),
(8, 'Your voice assistant is everywhere', 1, '<p style=\"text-align: justify; \">Your voice assistant is everywhere&nbsp;</p><p style=\"text-align: justify; \">The 2017 CES was a big year for voice assistants (particularly Amazon Alexa) and we expected more of the same this year. So far, though, it is Samsung\'s Bixby and Google Assistant that are grabbing the spotlight.&nbsp;</p><p style=\"text-align: justify; \">Samsung said it will take Bixby, already available on its phones, and add the voice assistant to to its TVs in 2018. Press a button on your TV remote to use Bixby to search for TV shows and movies, check the weather, turn on your lights, play a song from Spotify and show photos. Samsung also improved Bixby integration on the Family Hub smart fridge by adding the ability to distinguish between different voices. Outside of Samsung, iHeartRadio unveiled Bixby support.</p><p style=\"text-align: justify; \">LG, meanwhile, has opted for Google Voice Assistant on its TVs. The \"Intelligent Voice Control with Integrated Google Assistant\" (great name!) will enable users to control numerous functions on the TV and search the program guide using the remote control. If you can\'t find your remote, you\'ll be able to control your TV with a Google Home speaker instead. Alexa users are in luck, as well. LG says the TV will be compatible with Amazon Echo devices.</p><p style=\"text-align: justify; \">Beyond TVs, voice assistants continue to spread farther into the home at CES. Google Assistant will control Insteon smart home devices, new Schlage deadbolts, a Hunter ceiling fan and a new LG smart speaker. Alexa, on the other hand, lands in products like an Asus speaker/router, a mirror that talks back to you and a Whirlpool smart washer/dryer hybrid. LG also added new Alexa tricks to its InstaView Q refrigerator.&nbsp;</p><div style=\"text-align: justify; \"><br></div>', 1, 1, NULL, 1, '2018-01-10 09:23:15', '2018-01-10 09:23:15', 1),
(9, 'Google goes big', 1, '<p style=\"text-align: justify; \"><br></p><p style=\"text-align: justify; \">Google isn\'t a wallflower at CES, and I\'m not talking about the giant Google pavilion with the slides or the Google-branded monorails (what\'s it called?!) that keep shuttling back and forth. The company also revealed four new smart displays. Designed to compete against Amazon\'s Echo Show, the displays are basically tablets with Google Assistant built in.</p><p style=\"text-align: justify; \">Sony, Samsung-owned JBL, LG and Lenovo make the displays for the non-hardware company. Prop them on your kitchen counter to do everything you\'d expect from a smart speaker, like play music, check the weather, check appointments and operate your Google Assistant-connected devices around the house. They also let you make video calls, watch YouTube videos and look at photos using the \"Hey, Google\" wake-up call.</p><p style=\"text-align: justify; \">Intel CEO Brian Krzanich opened up the company\'s keynote presentation with remarks on Meltdown and Spectre, two security flaws that have sent shockwaves through the industry.</p><p style=\"text-align: justify; \">James Martin/CNET</p><div style=\"text-align: justify; \"><br></div>', 1, 1, NULL, 1, '2018-01-10 09:25:33', '2018-01-10 09:25:33', 0),
(10, 'Intel\'s keynote', 1, '<h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">Intel\'s keynote&nbsp;</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">CEO Brian Krzanich came to Las Vegas to talk about the future, but he had to spend a few minutes (two minutes, to be exact) on the Spectre and Meltdown vulnerabilities to its chips that researchers found last week. Krzanich said Intel is working on fixing the performance flaws, but he did not address slower post-patch performance and his own controversially timed stock sale.</span></font></h2><h2 style=\"margin: 11.25pt 0in; text-align: justify; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">In future news, Intel said it will build highly detailed maps of roads around the world for self-driving vehicles with cameras already installed in production cars. The company also announced an exploratory partnership with Paramount Pictures to create new kinds of entertainment, a plan to bring VR to 30 events at the Olympics and a Volocopter autonomous passenger drone. Krzanich said that by the end of this year Intel would meet diversity goals (set in 2015) for \"full representation\" of women and minorities.</span></font></h2><div style=\"text-align: justify;\"><br></div>', 1, 1, NULL, 1, '2018-01-10 09:28:49', '2018-01-10 09:28:49', 1),
(11, 'Car tech and much more', 1, '<div><span style=\"white-space: pre;\">	</span>HTC debuted the Vive Pro, a new version of its PC VR headset with improved resolution and full wireless capabilities.<br></div><div><span style=\"white-space:pre\">	</span>GE Appliances has a smart home hub and control center for your kitchen. Hang the huge tablet above your stove and tap away.</div><div><span style=\"white-space:pre\">	</span>If you thought Volvos were boxy, wait until you see Toyota\'s e-Palette concept vehicle.&nbsp;</div><div><span style=\"white-space:pre\">	</span>Kia\'s showed a fully electric version of its Niro model.</div><div><span style=\"white-space:pre\">	</span>LG\'s CLOi will respond to your commands via the LG Hub Robot and can help with the chores. It\'s cute, even if the poor little thing didn\'t have the best introduction at LG\'s press conference.&nbsp;</div><div><span style=\"white-space:pre\">	</span>Asus\'s Zenbook Flip 14 has the latest Intel Core processor.</div><div><span style=\"white-space:pre\">	</span>NeoMano is a robotic glove that helps people with a spinal cord injury perform everyday tasks.</div><div><span style=\"white-space:pre\">	</span>Airbags for your hips to protect you in case you fall? Sure, why not?</div><div><span style=\"white-space:pre\">	</span>A robot called Sophia can walk and even dance on her new legs. She\'s not creepy at all.</div><div><span style=\"white-space:pre\">	</span>Lenovo also delivered the 2-in-1 Miix 630 with a Snapdragon 835 processor, the first PC with Dolby Vision high dynamic range imaging, a new version of the Lenovo ThinkPad X1.</div><div>appable modules</div><div>CES 2018: Complete coverage of the world\'s biggest technology show from CNET.</div><div>The coolest new gadgets at CES 2018: Here are the best new announcements we\'ve seen so far.</div><div>SHARE YOUR VOIC</div><div><br></div>', 1, 1, NULL, 1, '2018-01-10 09:30:02', '2018-01-10 09:30:02', 1),
(12, 'Wireless earbuds that actually last awhile are on their way', 1, '<p style=\"text-align: justify; \"><span style=\"font-family: Helvetica;\">More-efficient earbuds are just one of Qualcomms announcements at CES 2018 as the company pushes beyond smartphone technology.</span><br></p><p style=\"text-align: justify; \"><span style=\"font-family: Helvetica;\"> You\'ll never see Qualcomm\'s name in retail stores because it builds the processors and components that go inside popular devices like Apple\'s iPhone, but its technology can hint at the capabilities of products coming in the next year and beyond. More-efficient wireless earbuds -- sometimes dubbed hearables -- are just one of the glimpses of the future that Qualcomm is offering at the trade show. The company is also talking up its work with smart speakers, as well as with automobiles. </span><span style=\"white-space: pre; font-family: Helvetica;\">	</span></p><p style=\"text-align: justify; \"><span style=\"font-family: Helvetica;\"> The mobile chip giant on Monday unveiled a low-power Bluetooth processor, the QCC5100, at its CES 2018 press conference at the Mandalay Bay Hotel in Las Vegas. The chip integrates into one package the Bluetooth tech that connects to other devices, the application processor that serves as the brain of the device, the digital signal processor that processes data in real time and other technology.</span><span style=\"white-space: pre; font-family: Helvetica;\">	</span></p><p style=\"text-align: justify; \"><span style=\"font-family: Helvetica;\"> Get ready for smaller, longer-lasting wireless earbuds, thanks to a new Bluetooth processor from Qualcomm.</span></p><div style=\"text-align: justify; \"><br></div>', 1, 1, NULL, 1, '2018-01-10 09:34:26', '2018-01-10 09:34:26', 1),
(13, 'Your earbuds are shrinking', 1, '<p>Wireless earbuds are great -- until they run out of battery just when you need them for a run.<br></p><p>The all-in-one QCC5100 chip cuts power consumption by up to 65 percent for both voice calls and audio streaming, when compared with previous Bluetooth audio processors.</p><p>This means that starting later this year -- likely around the winter holidays, Qualcomm said -- you\'ll be able to buy wireless earbuds with triple the playback time from current-generation products that are the same size.</p><p><br></p><p>Qualcomm\'s new Bluetooth chip will enable smaller earbud designs, like this prototype created by the company.</p><p><br></p><p>Some companies instead may make your earbuds even smaller, giving you the same battery life as current products in a more compact package. And the smarts in these earbuds will be twice as fast, letting you interact more naturally with the digital voice assistants whispering in your ear.</p><p>\"Devices are going well beyond music playback and voice calls,\" Anthony Murray, senior vice president and general manager of Qualcomm\'s voice and music operations, said in an interview ahead of the announcement.</p><p>To that end, the new chip will let you listen to music, make calls, access voice assistants and run biometric sensors like heart rate. It also supports active noise cancellation, which makes everything sound much clearer.</p><p>You may even be able to call on your voice assistant just by speaking aloud. Currently, you must tap or press a button to access them on earbuds since activating always-listening features would drain the already short battery life. But the QCC5100 supports always-on voice detection.</p><p>Murray estimated the earbuds will be able to last 12 or more hours for playback. If you\'re accessing all of the features, like biometrics, the voice assistant and other areas, you\'d probably get about three to five hours of battery life. For comparison, Apple\'s AirPods (which use its own W1 Bluetooth chip) and Samsung\'s IconX earbuds both boast five hours of battery life when streaming audio over Bluetooth.</p><div><br></div>', 1, 1, NULL, 1, '2018-01-10 09:35:43', '2018-01-10 09:35:43', 1),
(14, 'Beyond smartphones', 1, '<p>Qualcomm last month unveiled its new Snapdragon 845 processor that likely will power many of the world\'s highest-end smartphones this year. The company at that time also showed off the first two-in-one PCs that use its chips and act more like phones. Those include the Asus NovaGo and the HP Envy X2. Both sport Qualcomm\'s Snapdragon 835 processor and its X16 LTE modem, giving them the smarts and connectivity speed traditionally found only in smartphones.<br></p><p>Qualcomm on Monday noted other partnerships that are helping it expand beyond smartphones.</p><p>For one, there\'s Amazon. Qualcomm\'s new \"Smart Audio Platform\" is designed to make it easier for companies to build smart speakers and other audio devices that use Amazon\'s Alexa digital voice assistant. The companies working with Qualcomm will be able to customize the speakers how they want and offer always-ready wake word detection and integrated Hi-Fi audio playback, among other features.</p><p>\"To build a smart speaker is a lot more complicated than you might imagine,\" Qualcomm\'s Murray told CNET. The Smart Audio Platform \"really slashes the time to market.\"</p><p>The result will be a flood of new speakers beyond Amazon\'s Echo line and the Google Home family.</p><p>Qualcomm also said its Snapdragon chips power the 2018 Honda Accord\'s infotainment and telematics systems. Qualcomm said Chinese energy company BYD plans to use Qualcomm\'s technology in its upcoming electric vehicles.</p><div><br></div>', 0, 1, NULL, 1, '2018-01-10 09:36:51', '2018-01-10 09:36:51', 1),
(15, 'Cloudy cloud computing', 1, '<p style=\"text-align: justify; \"><br></p><p style=\"text-align: justify; \">An increasingly important part of tech ecosystems is the smart home. The Consumer Technology Association, which hosts CES, estimates that sales of smart home devices will reach 40.8 million units and $4.5 billion -- up 41 percent and 34 percent, respectively, from 2017. It expects smartphone and TV unit sales, meanwhile, to both rise only 2 percent.</p><p style=\"text-align: justify; \">The SmartThings cloud, Samsung\'s way to connect its devices, isn\'t exactly an easy theme to explain, and it\'s also not something that really gets consumers running to the stores. After all, you can\'t hold the cloud in your hand like a shiny new smartphone. But for Samsung, and its users, it\'s important.&nbsp;&nbsp;</p><p style=\"text-align: justify; \">Watch this: Best moments from Samsung\'s CES 2018 press conference</p><p style=\"text-align: justify; \">5:31&nbsp;</p><p style=\"text-align: justify; \">\"It\'s the glue that pulls everything together, not the big feature consumers will clamor for,\" Moor Insights &amp; Strategy analyst Pat Moorhead said.</p><p style=\"text-align: justify; \">Still, this isn\'t the first time Samsung\'s talked about one cloud and connecting all of its devices together. And it\'s definitely not the first time it\'s pushed its vision of IOT. Whether it will succeed this time is a big question.</p><p style=\"text-align: justify; \">Samsung declined to make an executive available to comment on this story.</p><div style=\"text-align: justify; \"><br></div>', 1, 1, NULL, 1, '2018-01-10 09:43:48', '2018-01-10 09:43:48', 1),
(16, 'If at first you don\'t succeed', 1, '<p class=\"MsoNormal\" style=\"text-align: justify; margin: 11.25pt 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">While Samsung makes some of the best-reviewed TVs and smartphones out there, software and services haven\'t been its forte. Its Tizen software hasn\'t caught on in smartphones and instead has been relegated to smartwatches and TVs. Samsung has scrapped many of the services it\'s created, like the WatchOn app to stream video from phones to TVs and its Samsung Media Hub and Milk Video services.</span></font></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 11.25pt 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">Even programs that are popular with consumers don\'t always work as planned. A couple of years ago, SmartThing was hampered by glitches that caused users\' lights, security cameras and other smart home devices to malfunction.</span></font></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 11.25pt 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">And Samsung has tended to cram many features into its smartphones, TVs and even new smart refrigerators that consumers don\'t even know exist. Bixby was its answer for getting around that, but even Bixby gets criticized by users who think it should be able to do more.</span></font></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 11.25pt 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">Samsung has long tried to get its devices to talk to each other -- with little success. Currently, it has at least four different cloud services that users can tap into. There\'s SmartThings, which it acquired over three years ago. That software works with non-Samsung products, including Philips Hue light bulbs and the Amazon Echo.</span></font></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 11.25pt 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">Then there\'s Samsung Smart View, which lets you stream from your phone or computer to your Samsung TV. The company\'s also got Samsung Connect, the smart home control app that\'s less than a year old, and its Smart Home app that lets you monitor and control your devices from wherever you are.</span></font></p><p class=\"MsoNormal\" style=\"text-align: justify; margin: 11.25pt 0in; background-image: initial; background-position: initial; background-size: initial; background-repeat: initial; background-attachment: initial; background-origin: initial; background-clip: initial;\"><font face=\"Helvetica, sans-serif\"><span style=\"font-size: 18.6667px;\">All of those will be rolled into the SmartThings app to connect, control and monitor any SmartThings-enabled device -- which includes Samsung products and devices from other companies  from your phone, TV or your car. The revamped cloud service will be available this spring.</span></font></p>', 0, 1, NULL, 1, '2018-01-10 09:45:46', '2018-01-10 02:54:01', 1),
(17, 'Crowded room', 1, '<p style=\"text-align: justify; \"><br></p><p style=\"text-align: justify; \">Even with simpler, integrated cloud, Samsung faces rival services that consumers are already familiar with: Google and Amazon.</p><p style=\"text-align: justify; \">Google, which builds the Android software running the vast majority of Samsung\'s smartphones and tablets, happens to have a major cloud business of its own, as well as a popular voice assistant. And Amazon, also a large cloud computing provider, has largely taken over the smart home arena with its Alexa voice assistant.&nbsp;&nbsp;</p><p style=\"text-align: justify; \">Samsung has had some recent success with services. Its Samsung Pay mobile payments technology is accepted almost everywhere, and its Knox security software keeps evolving to keep devices safe. Knox now appears in Samsung\'s connected devices like smart TVs and appliances.</p><p style=\"text-align: justify; \"><br></p><p style=\"text-align: justify; \">And Samsung touts a lot of benefits from its new IoT vision and SmartThings cloud. For instance, your 2018 Samsung TV will be easier to set up, while your Family Hub refrigerator will be able to recognize individual voices and give personalized responses and information to each family member.</p><p style=\"text-align: justify; \">If Samsung\'s new SmartThings cloud actually works, it could change the way you use your devices, likely without you even realizing why.</p><p style=\"text-align: justify; \">Let\'s hope the SmartThings cloud doesn\'t go the way of Samsung\'s other services: Abandoned in a year or two.</p><div style=\"text-align: justify; \"><br></div>', 1, 1, NULL, 1, '2018-01-10 09:46:49', '2018-01-10 09:46:49', 1);
